import React, { useEffect, useState } from "react";
import { auth } from "../firebase/firebase"; // Assuming you have a firebase config file
import { useNavigate } from "react-router-dom";

function Home() {
  const navigate = useNavigate();
  const [user, setUser] = useState(null);
  console.log(user)

  useEffect(() => {
    const unsubscribe = auth.onAuthStateChanged((currentUser) => {
      setUser(currentUser);
    });

    return unsubscribe; // Clean up listener on component unmount
  }, []);

  const logout = () => {
    auth.signOut().then(() => {
      localStorage.clear();
      navigate("/");
    });
  };

  return (
    
    <div>
      {user ? (
        
        <h1>
          Hello, {user.displayName || user.email}!
        </h1>
      ) : (
        <h1>
          Please sign in to see your name.
        </h1>
      )}
        <iframe   style={{border: "0", width: "100%", height: "270px"}}  src="https://www.google.com/maps/place/588+Ph%E1%BA%A1m+H%E1%BB%AFu+L%E1%BA%A7u,+Ph%C6%B0%E1%BB%9Dng+6,+TP.+Cao+L%C3%A3nh,+%C4%90%E1%BB%93ng+Th%C3%A1p,+Vi%E1%BB%87t+Nam/@10.4303232,105.6312716,17z/data=!3m1!4b1!4m5!3m4!1s0x310a65226cdb84c9:0x9159711d8df83eba!8m2!3d10.4303232!4d105.6338465?entry=ttu" frameborder="0" allowfullscreen=""></iframe>
      <button onClick={logout}>Logout</button>
    </div>
  );
}

export default Home;
